const axios = require('axios');

const getUsers = (handleSuccess) => {
    axios.get("http://localhost:8000/login")
    .then(result => handleSuccess(result.data))
}

// const getUsers = (handleSuccess) => {
//     axios.get("http://localhost:8000/login")
//     .then(result => handleSuccess(result.data))
// }


export {getUsers};
